import { Box } from '@material-ui/core';
import go from '../Assets/Images/go.jpg';
import logo from '../Assets/Images/logo.jpg';

const LandingPage = () => {
    return (
        <div>
            <Box>
                <img src={logo} style={{margin: '60px 0px 0 650px'}} />
            </Box>
        </div>
    )
}

export default LandingPage;
